import React from "react";
import Table from "react-bootstrap/Table";
import PropTypes from "prop-types";

const TransactionsList = ({ transactionData }) => {
  const displayBoard = () => {
    return sortedBoards.map((board, index) => {
        return (
            <li
                className={
                    board.id === selected.id
                        ? 'board-menu-item__selected'
                        : null
                }
                key={index}
                onClick={() => selectBoard(board.id)}>
                {board.title}
            </li>
        );
    });
};

  const transactionInfo = () => {
    return transactionData.map((transaction, i) => (
      // <a href="#">
      // <tr>
      <tr key={i}>
        {/* <td><a href="./">{transaction.id}</a></td> */}
        <td>{transaction.customer}</td>
        <td>{transaction.admin}</td>
        <td>{transaction.drop_off}</td>
        <td>{transaction.description}</td>
        <td>{transaction.items.length}</td>
      </tr>
    ));
  };

  return (
    <>
      <Table striped hover>
        <thead>
          <tr>
            <th>Customer</th>
            <th>Admin</th>
            <th>Dropped Off</th>
            <th>Message</th>
            <th>Items</th>
          </tr>
        </thead>
        <tbody>{transactionInfo()}</tbody>
      </Table>
    </>
  );
};

TransactionsList.propTypes = {
  transactions: PropTypes.array,
};

export default TransactionsList;
